  "Broker Comment" : "AGUERO'S AFFIRMATIVE RESPONSES ON HIS U4 REFERENCES HIS PROBLEM WITH CLIENT M.L. RYAN (\"M.L.R.\") WHILE HE WAS A BROKER WITH FIRST EQUITY CORPORATION OF FLORIDA, WHICH RESULTED IN THE FILING OF NASD COMPLAINT #ATL-85 ON APRIL 17, 1986. THE NASD COMPLAINT ALLEGED THAT, FROM 10/4/83 TO 10/11/83, AGUERO EFFECTED FIVE TRANSACTIONS IN OPTION CONTRACTS FOR THE SECURITIES ACCOUNT OF PUBLIC CUSTOMER M.L.R. WITHOUT HER AUTHORIZATION OR CONSENT; THAT FROM 10/20/83 TO 8/17/84, AGUERO EXERCISED WRITTEN DISCRETIONARY POWER IN EFFECTING DIVERSE TRANSACTIONS IN OPTION CONTRACTS FOR THE ACCOUNT OF M.L.R. WITHOUT THE PRIOR WRITTEN ACCEPTANCE OF THE ACCOUNT BY HIS EMPLOYER/MEMBER TO ITS DULY AUTHORIZED DESIGNEE; AND THAT, ON 2/3/83 AND ON 6/18/84, AGUERO MISREPRESENTED THE VALUE OF THE CUSTOMER'S SECURITIES ACCOUNT TO HER ATTORNEY IN ORDER TO CONCEAL SUBSTANTIAL LOSSES SUFFERED BY THE ACCOUNT. IN AN ORDER OF ACCPETANCE OF OFFER OF SETTLEMENT DATED AUGUST 22, 1986  FOR COMPLAINT #ATL-857, IT WAS THE DECISION OF THE DBCC THAT AGUERO BE CENSURED, FINED $4,500 AND SUSPENDED FROM ASSOCIATION WITH A MEMBER IN ANY CAPACITY FOR A PERIOD OF 30 DAYS, THE COMMENCEMENT OF WHICH WILL BE SET BY THE PRESIDENT OF THE ASSOCIATION. "
}

