  "Sanction Details" : "I WAS DENIED A LICENSE IN MARCH, 1979.  IN ADDITION, TO APPROVE MY REGISTRATION IN FLORIDA IN 1987, THE STATE SET THE FOLLOWING CONDITIONS:  THAT I BE STRICTLY SUPERVISED; THAT I NOT EXERCISE ANY DISCRETIONARY AUTHORITY; THAT I NOT ACT IN ANY PRINCIPAL OR MANAGERIAL CAPACITY; AND THAT I IMMEDIATELY REPORT ANY COMPLAINT OR ACTION FILED AGAINST ME.  ON 8/26/1996 THE STATE GRANTED RELIEF FROM THESE REGISTRATION AGREEMENT CONDITIONS.",
  "Broker Comment" : "SERGIO LUIS AGUERO WAS NEVER REQUESTED ADDITIONAL INFORMATION BY THE STATE OF FLORIDA IN 3/79 OR ON ANY OTHER DATE. MR. AGUERO TOOK THE MATTER UP WITH MR. JOSE FERNANDEZ, COMPLIANCE OFFICER OF FIRST EQUITY CORP. OF FLORIDA, AND WAS INFORMED THAT FIRST EQUITY HAD, IN 1979, FILED AN APPLICATION FOR MR. AGUERO TO TAKE A SERIES 7 EXMINATION WITH THE NASD AND THE STATE OF FLORIDA. WHEN MR. AGUERO DID NOT, THE STATE OF FLORIDA CANCELLED THE APPLICATION WHICH HAD BEEN SUBMITTED.  MR. AGUERO WAS ACTIVELY IN BUSINESS IN SPAIN UNTIL THE SUMMER OF 1980. DURING 1978 AND 1979, MR. AGUERO HAD VISITED MIAMI AND THE OFFICES OF FIRST EQUITY. IN 3/79, MR. AGUERO THOUGHT HE COULD TAKE THE SERIES 7 EXAM, BUT MR. AGUERO NEVER FOLLOWED THROUGH.  IT WAS NOT UNTIL 1980 THAT MR. AGUERO FINALLY TOOK THE SERIES 7 EXAMINATION."
